  return (
    <header>
      <h1>URL Shortener</h1>
      <nav>
        <ul>
          <a href="/">Home </a>
          <a href="/user/login"> Login </a>
          <a href="/user/signup"> Signup </a>
        </ul>
      </nav>
    </header>
  );
}
function Header2() {
  return (
    <div className="header">
      {/* Add your header content here */}
    </div>
  );
}


